import {
  AspectRatio,
  Box,
  Card,
  CardContent,
  Chip,
  CircularProgress,
} from "@mui/joy";
import { Container, Grid, Stack, Typography } from "@mui/material";
import CountUp from "react-countup";

export default function MySkill() {
  const experienceList = [
    {
      icon: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/200px-React-icon.svg.png",
      experienceYear: 2,
      experienceName: "REACT JS",
    },
    {
      icon: "https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/WordPress_blue_logo.svg/1200px-WordPress_blue_logo.svg.png",
      experienceYear: 2,
      experienceName: "WORDPRESS",
    },
    {
      icon: "https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Unofficial_JavaScript_logo_2.svg/1200px-Unofficial_JavaScript_logo_2.svg.png",
      experienceYear: 2,
      experienceName: "JAVASCRIPT",
    },
    {
      icon: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ee/.NET_Core_Logo.svg/2048px-.NET_Core_Logo.svg.png",
      experienceYear: 2,
      experienceName: ".NET",
    },
  ];

  const { value: v1, reset: r1 } = useCountUp({
    isCounting: true,
    duration: 1.7,
    start: 0,
    end: 64,
  });

  function mapToRange(number, min, max) {
    const mappedValue = ((number - min) / (max - min)) * 100;
    return Math.round(mappedValue);
  }

  const value = 640;
  const minValue = 0;
  const maxValue = 1000;

  const mappedValue = mapToRange(value, minValue, maxValue);

  const { value: v2, reset: r2 } = useCountUp({
    isCounting: true,
    duration: 2.3,
    start: 0,
    end: mappedValue,
  });
  return (
    <Container
      maxWidth="fluid"
      sx={{ backgroundColor: "#0D0D0D", pt: 15, pb: 15 }}
    >
      <Container maxWidth="lg">
        <Stack
          direction="row"
          justifyContent="space-between"
          alignItems="center"
        >
          <Stack spacing={2}>
            <Typography variant="body1" fontWeight="bold" color="#c9f31d">
              MY SKILLS
            </Typography>
            <Typography variant="h4" fontWeight="bold" color="white">
              Lets Explore My
              <br /> <b style={{ color: "#c9f31d" }}>Skills and Experience</b>
            </Typography>
          </Stack>
          <Grid container spacing={2}>
            {experienceList.map((value, index) => (
              <Grid item xs={4} key={index}>
                <Card variant="soft" color="primary" invertedColors>
                  <CardContent orientation="horizontal">
                    <CircularProgress size="lg" determinate value={Number(v1)}>
                      <Typography>{v1}%</Typography>
                    </CircularProgress>
                    <CardContent>
                      <Typography level="body-sm">Daily profit</Typography>
                      <Typography level="h4">
                        <CountUp
                          prefix="$ "
                          start={0}
                          duration={3.75}
                          end={1534.73}
                          // suffix="K"
                          separator=","
                          decimals={2}
                        >
                          {({ countUpRef, start }) => (
                            <Box
                              sx={{
                                display: "flex",
                                alignItems: "center",
                                justifyContent: "space-between",
                              }}
                            >
                              <span ref={countUpRef} />
                            </Box>
                          )}
                        </CountUp>
                      </Typography>
                    </CardContent>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Stack>
      </Container>
    </Container>
  );
}
